import { HOME_PAGE } from '../../constants/routes';
import { useNavigate } from 'react-router-dom';
import { authGoogle } from '../../api/auth';



const GoogleSignInButton = () => {
  const { dispatch } = useAuthContext();
  const navigate = useNavigate();


